import React from 'react';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, ResponsiveContainer } from 'recharts';

const HealthModule = ({ 
  title, 
  icon, 
  data, 
  currentValue, 
  unit, 
  color, 
  insights, 
  delay = 0 
}) => {
  return (
    <div 
      className="max-w-4xl mx-auto mb-12 px-6 animate-fade-in"
      style={{ animationDelay: `${delay}ms` }}
    >
      <div className="bg-white rounded-2xl shadow-lg p-8 border border-gray-100">
        {/* Module Header */}
        <div className="flex items-center mb-6">
          <div className="text-3xl mr-4">{icon}</div>
          <h2 className="text-2xl font-bold text-gray-800">{title}</h2>
        </div>

        {/* Current Value Display */}
        <div className="text-center mb-8">
          <div className="text-5xl font-bold mb-2" style={{ color }}>
            {currentValue}
          </div>
          <div className="text-gray-600 text-lg">{unit}</div>
        </div>

        {/* Graph */}
        <div className="h-64 mb-8">
          <ResponsiveContainer width="100%" height="100%">
            <LineChart data={data}>
              <CartesianGrid strokeDasharray="3 3" stroke="#f0f0f0" />
              <XAxis 
                dataKey="time" 
                stroke="#666"
                fontSize={12}
                tickLine={false}
                axisLine={false}
              />
              <YAxis 
                stroke="#666"
                fontSize={12}
                tickLine={false}
                axisLine={false}
              />
              <Tooltip 
                contentStyle={{
                  backgroundColor: 'white',
                  border: '1px solid #e5e7eb',
                  borderRadius: '12px',
                  boxShadow: '0 10px 25px -5px rgba(0, 0, 0, 0.1)',
                  fontSize: '14px'
                }}
              />
              <Line 
                type="monotone" 
                dataKey="value" 
                stroke={color}
                strokeWidth={3}
                dot={{ fill: color, strokeWidth: 2, r: 5 }}
                activeDot={{ r: 8, stroke: color, strokeWidth: 2, fill: 'white' }}
              />
            </LineChart>
          </ResponsiveContainer>
        </div>

        {/* LLM Insights */}
        <div className="space-y-4">
          <div className="flex items-center mb-4">
            <div className="text-sm font-medium text-gray-500 uppercase tracking-wide">
              Generated by Nomi's LLM Wellness Engine
            </div>
          </div>
          
          <div className="space-y-3">
            {insights.map((insight, index) => (
              <p 
                key={index}
                className="text-gray-700 leading-relaxed text-lg"
              >
                {insight}
              </p>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
};

export default HealthModule;
